package com.ownobj.aspect.service.impl;

import java.nio.charset.Charset;

import org.springframework.http.HttpEntity;
import org.springframework.http.HttpHeaders;
import org.springframework.http.HttpMethod;
import org.springframework.http.MediaType;
import org.springframework.http.ResponseEntity;
import org.springframework.http.client.HttpComponentsClientHttpRequestFactory;
import org.springframework.http.converter.StringHttpMessageConverter;
import org.springframework.stereotype.Component;
import org.springframework.util.LinkedMultiValueMap;
import org.springframework.util.MultiValueMap;
import org.springframework.web.client.RestClientException;
import org.springframework.web.client.RestTemplate;

import com.alibaba.fastjson.JSONObject;
import com.ownobj.aspect.service.IdCardUploadService;

@Component
public class IdCardUploadServiceImpl implements IdCardUploadService{
	
	
	
	public void Post(){  
		String url = "http://cloud.exocr.com/recognize";
		//HttpComponentsClientHttpRequestFactory httpRequestFactory = new HttpComponentsClientHttpRequestFactory();
		//设置超时时间，请求时间，连接时间，读取时间，都是1秒，这里都是用静态变量
		//获取对话
		RestTemplate restTemplate = new RestTemplate();
		restTemplate.getMessageConverters().add(new StringHttpMessageConverter(Charset.forName("utf-8"))); 
		
		MediaType type = MediaType.parseMediaType("application/json; charset=UTF-8");
		HttpHeaders headers = new HttpHeaders();
		headers.setContentType(type);
		//JSON contentType
		headers.add("Accept", MediaType.APPLICATION_JSON.toString());
		//我们发起 HTTP 请求还是最好加上"Connection","close" ，有利于程序的健壮性
		headers.set("Connection","close");
		
		JSONObject jObj = new JSONObject();
		jObj.put("username","test");
		jObj.put("password","test");
		jObj.put("recotype","IdCard");
		jObj.put("encoding","UTF-8");
		jObj.put("head_portrait","0");
		jObj.put("crop_image","0");
		jObj.put("b64","1");
		jObj.put("image","");

		HttpEntity<String> requestEntity = new HttpEntity<String>(jObj.toJSONString(), headers);
		ResponseEntity<String> response = restTemplate.postForEntity(url, requestEntity, String.class );
		try {
		    //发起请求
		    response = restTemplate.exchange(
		    		String.format("http://cloud.exocr.com/recognize", "utf-8"),
		            HttpMethod.POST,//post
		            requestEntity,
		            String.class);
		    //获取返回值
		    String resTxt = response.getBody();
		    System.out.println(resTxt);
		} catch (RestClientException e) {
		    throw e;
		}
	}
}

